  const [posts, setPosts] = useState([]);

  useEffect(() =>{
    const fetchPosts = async () =>{
      const res = await axios.get(`users/${post.userId}`);
      setPosts(res.data);
    };
    fetchPosts();
  },[])

  return (
    <div className="feed">
      <div className="feedWrapper">
        <Share/>
        {posts.map((p)=> (
